import React from 'react';
import './Project.css';
const Projects = () => {
  return (
    <section className="projects-section" id="projects">
      <div className="container">
        <h2 className="section-title">Projects</h2>
        <div className="project-grid">
          {/* Pet Project */}
          <div className="project-card">
            <img src="https://via.placeholder.com/300x180" alt="Kiddo Band" className="project-img" />
            <h3>Kiddo Band</h3>
            <p>A wearable device for kids to send SOS alerts, track vitals, and notify parents when injured.</p>
            <a href="#" className="btn-project" target="_blank" rel="noreferrer">View Project</a>
          </div>

          {/* Sample Project */}
          <div className="project-card">
            <img src="https://via.placeholder.com/300x180" alt="Sample Project" className="project-img" />
            <h3>Sample Portfolio</h3>
            <p>A minimal and responsive personal portfolio built using React and Bootstrap.</p>
            <a href="#" className="btn-project" target="_blank" rel="noreferrer">View Project</a>
          </div>
        </div>
      </div>
    </section>
  );
};


export default Project;
